import React from "react";

export default function EmptyCart() {
  return (
    <div className="container mt-5">
      <div className="row">
        <div className="col-10 mx-auto text-center">
          <p className="text-uppercase">Your cart is empty</p>
        </div>
      </div>
    </div>
  );
}
